import { Link } from 'react-router-dom';
import React from "react";
// import { BrowserRouter, Route, Routes } from "react-router-dom";
import Profil from './Profil.js';
import PregledArtikala from './PregledArtikala.js';

const UlogovanKorisnik = () => {
  return (
    <div>

        <Link to="/ulogovan-korisnik/profil">Profil</Link>
        <Link to="/ulogovan-korisnik/pregled-artikala">Pregled artikala</Link>
        
    </div>
        
      
    
  );
};

export default UlogovanKorisnik;
